/* Procedure structure for procedure `sp_hapusmahasiswa` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_hapusmahasiswa` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_hapusmahasiswa`(_nrp varchar(32))
BEGIN
	DELETE FROM USER WHERE username=_nrp AND role=3;
	delete from data_mahasiswa where nrp=_nrp;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_login` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_login` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_login`(_username varchar(32), _password varchar(100))
BEGIN
	SELECT username, role FROM USER WHERE username=_username AND PASSWORD=MD5(_password);
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_tambahmhs` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_tambahmhs` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_tambahmhs`(_nrpawal varchar(32),_nrpakhir VARCHAR(32))
BEGIN
	SET @i := _nrpawal;
	loop1:while @i <= _nrpakhir DO
		insert into user values(@i,md5(@i),3);
		insert into data_mahasiswa (nrp,status_isi) values(@i,0);
		SET @i = @i + 1;
	end while loop1;
END */$$
DELIMITER ;

